package cn.test_03;

public class Demo {
	private int age;
	private String name;


	public Demo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Demo(int age, String name) {
		super();
		this.age = age;
		this.name = name;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

}
